import React from "react";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import Header from "./components/Header";
import Home from "./pages/Home";
import Students from "./pages/Students"; // ✅ Import Students Page
import Courses from "./pages/Courses"; // ✅ Import Courses Page
import CourseStudents from "./pages/CourseStudents"; // Add this import

const App = () => {
  return (
    <Router>
      <Header />
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/students" element={<Students />} />
        <Route path="/courses" element={<Courses />} />
        <Route path="/course-students/:courseId" element={<CourseStudents />} />
      </Routes>
    </Router>
  );
};

export default App;
